import { Stack, Text } from "@chakra-ui/react";
import Message from "../components/Message";

function MessageChoices({ options, onSelect, isUser }) {
    return (
      <Stack>
        <Text alignSelf={isUser ? 'flex-start' : 'flex-end'}>Select a message:</Text>
        {options.map((option, index) => (
          <Message key={index} onClick={() => onSelect(option)} isUser={isUser}>{option}</Message>
        ))}
      </Stack>
    );
}

export default MessageChoices;
